INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 401, 102301, "2030/12/17 14:59:59", 10046, 2, 24001, "アヤネ", 0.0, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 402, 102301, "2030/12/17 14:59:59", 10046, 1, 24002, "アヤネ", 0.0, 2, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, "2020/07/31 12:00:00", 2.21);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 403, 102301, "2030/12/17 14:59:59", 10046, 2, 24003, "アヤネ", 0.0, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 701, 192201, "2030/12/17 14:59:59", 10046, 2, 24004, "アサヒ", 0.0, 1, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, "2020/07/31 12:00:00", 1.99);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 702, 192201, "2030/12/17 14:59:59", 10046, 1, 24005, "アサヒ", 0.0, 2, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, "2020/07/31 12:00:00", 2.21);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 703, 192201, "2030/12/17 14:59:59", 10046, 2, 24006, "アサヒ", 0.0, 1, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, "2020/07/31 12:00:00", 3.33);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 801, 192301, "2030/12/17 14:59:59", 10046, 2, 24007, "部員３", 0.0, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 802, 192301, "2030/12/17 14:59:59", 10046, 1, 24008, "部員３", 0.0, 2, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, "2020/07/31 12:00:00", 2.68);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 803, 192301, "2030/12/17 14:59:59", 10046, 2, 24009, "部員３", 0.0, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 501, 192501, "2030/12/17 14:59:59", 10046, 1, 24010, "", 0.0, 1, "やった！", 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 502, 192501, "2030/12/17 14:59:59", 10046, 1, 24011, "", 0.0, 1, "勝ったよ！", 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 503, 192501, "2030/12/17 14:59:59", 10046, 1, 24012, "", 0.0, 1, "いい調子！", 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 111, 113501, "2030/12/17 14:59:59", 10046, 6, 24013, "ミサト", 0.0, 2, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, "2020/07/31 12:00:00", 5.33);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 112, 113501, "2030/12/17 14:59:59", 10046, 1, 24014, "ミサト", 0.0, 2, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, "2020/07/31 12:00:00", 6.85);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 113, 113501, "2030/12/17 14:59:59", 10046, 1, 24015, "ミサト", 0.0, 2, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, "2020/07/31 12:00:00", 3.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 611, 192401, "2030/12/17 14:59:59", 10046, 1, 24016, "ダイチ", 0.0, 2, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, "2020/07/31 12:00:00", 6.11);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 612, 192401, "2030/12/17 14:59:59", 10046, 1, 24017, "ダイチ", 0.0, 2, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, "2020/07/31 12:00:00", 6.75);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 613, 192401, "2030/12/17 14:59:59", 10046, 2, 24018, "ダイチ", 0.0, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 211, 113401, "2030/12/17 14:59:59", 10046, 2, 24019, "ハツネ", 0.0, 1, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, "2020/07/31 12:00:00", 4.52);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 212, 113401, "2030/12/17 14:59:59", 10046, 2, 24020, "ハツネ", 0.0, 1, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, "2020/07/31 12:00:00", 3.89);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 213, 113401, "2030/12/17 14:59:59", 10046, 1, 24021, "ハツネ", 0.0, 2, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, "2020/07/31 12:00:00", 13.49);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 311, 106501, "2030/12/17 14:59:59", 10046, 1, 24022, "カヤ", 0.0, 2, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, "2020/07/31 12:00:00", 3.17);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 312, 106501, "2030/12/17 14:59:59", 10046, 1, 24023, "カヤ", 0.0, 2, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, "2020/07/31 12:00:00", 4.42);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 313, 106501, "2030/12/17 14:59:59", 10046, 6, 24024, "カヤ", 0.0, 1, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, "2020/07/31 12:00:00", 2.89);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 421, 102301, "2030/12/17 14:59:59", 10046, 4, 24025, "アヤネ", 0.0, 3, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, "2020/07/31 12:00:00", 3.71);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 721, 192201, "2030/12/17 14:59:59", 10046, 2, 24026, "アサヒ", 0.0, 1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, "2020/07/31 12:00:00", 5.1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 821, 192301, "2030/12/17 14:59:59", 10046, 1, 24027, "部員３", 0.0, 3, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, "2020/07/31 12:00:00", 4.34);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 521, 192501, "2030/12/17 14:59:59", 10046, 1, 24028, "", 0.0, 1, "いい勝負だったよ\nまたやろうね", 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 101, 113501, "2030/12/17 14:59:59", 10046, 1, 24029, "ミサト", -360.0, 2, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0, "2020/07/31 12:00:00", 5.62);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 102, 113501, "2030/12/17 14:59:59", 10046, 1, 24030, "ミサト", -360.0, 2, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0, "2020/07/31 12:00:00", 9.58);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 103, 113501, "2030/12/17 14:59:59", 10046, 2, 24031, "ミサト", -360.0, 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 104, 113501, "2030/12/17 14:59:59", 10046, 2, 24032, "ミサト", -360.0, 1, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0, "2020/07/31 12:00:00", 9.13);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES (24, 105, 113501, "2030/12/17 14:59:59", 10046, 1, 24033, "ミサト", -360.0, 2, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0, "2020/07/31 12:00:00", 8.27);
